def findShortestSubArray(nums):
    nums_dict = {}
    count = {}
    degree = 0
    minLength = len(nums)

    for i, num in enumerate(nums):
        if num not in nums_dict:
            nums_dict[num] = i
        count[num] = count.get(num, 0) + 1
        if count[num] > degree:
            degree = count[num]
            minLength = i - nums_dict[num] + 1
        elif count[num] == degree:
            minLength = min(minLength, i - nums_dict[num] + 1)

