def longestPalindrome(s):
    char_count = {}
    for char in s:
        if char in char_count:
            char_count[char] += 1
        else:
            char_count[char] = 1

    palindrome_len = 0
    odd_count = False
    for count in char_count.values():
        palindrome_len += count
        if count % 2 != 0:
            palindrome_len -= 1
            odd_count = True

    if odd_count:
        palindrome_len += 1

    return palindrome_len

